                lastAppCpuTime = appTime;
                lastCpuTime = cpuTime;
                return value;
            }
            value = (float) (appTime - lastAppCpuTime) / (float) (cpuTime - lastCpuTime) / (float) (appTime - lastAppCpuTime) * 100.0f;
            lastCpuTime = cpuTime;
            lastAppCpuTime = appTime;
        } catch (Exception e) {
            e.printStackTrace();
        }
        return value;
