            }
            EDIFNet logicalNet = parentNetName.getNet();
            List<EDIFPortInst> eprList = logicalNet.getSourcePortInsts(false);
            if (eprList.size() > 1) throw new RuntimeException("ERROR: Bad assumption on net, has two sources.");
            if (eprList.size() == 1) {
