            // Stop being called more than MAX_ATTEMPTS
            if (sessionItem.getAttemptCount() > MAX_ATTEMPTS) {

                LOGGER.error(
                        "Attempt count {} is over the max of {}",
                        sessionItem.getAttemptCount(),
