            Activity containerActivity = ((Activity) this.owner.getContextFromMutableContext());
            if (containerActivity != null && !containerActivity.isFinishing()) {
                containerActivity.finish();
            }
        } else {
            // state must be default
            owner.hide();
        }
    }


